public void a11_maxLength() {
	HeaderInfo t = new HeaderInfo();

	t.maxLength(123);
	assertObject(t.maxLength()).isType(Integer.class).is(123);

	t.maxLength("123");
	assertObject(t.maxLength()).isType(Integer.class).is(123);

	t.maxLength((String)null);
	assertObject(t.maxLength()).isNull();
}

